import { FiArrowDown } from "react-icons/fi"
import { IconContext } from "react-icons"

function CardListItem(props) {
    return (
        <li>{props.item}</li>
    )
}

const ProjectCard = ({projectName, date, description, languages, links}) =>  {

    return (
        <div className="border pt-4 pr-4 pl-1 flex">
            <h3 className="border text-2xl font-bold">{projectName}</h3>
            <IconContext.Provider value={{color: "blue", size: "1.75em", style: { verticalAlign: 'middle'} }}>
                <div>
                    <FiArrowDown/>
                </div>
            </IconContext.Provider>
        </div>
    )
}

export default ProjectCard
